@OptIn(ExperimentalCoroutinesApi::class)
class GetAlbumListUseCaseTest : BaseIntegrationTest() {

    // Mocks
    @Mock
    private lateinit var albumRepositoryMock: AlbumRepository

    // Class under test
    private lateinit var getAlbumListUseCase: GetAlbumListUseCase

    override fun build() {
        getAlbumListUseCase = GetAlbumListUseCase(albumRepositoryMock)
    }

    @Test
    fun `given valid query, when invoking GetAlbumListUseCase, then it should return Result Success with filtered albums`() =
        runTest {
            // Arrange
            val query = "rock"
            val expectedResult = mockk<List<Album>>()
            coEvery { albumRepositoryMock.searchAlbum(query) } returns Result.Success(expectedResult)

            // Act
            build()
            val result = getAlbumListUseCase(query)

            // Assert
            coVerify { albumRepositoryMock.searchAlbum(query) }
            assertEquals(Result.Success(expectedResult), result)
        }

    @Test
    fun `given null query, when invoking GetAlbumListUseCase, then it should return Result Success`() =
        runTest {
            // Arrange
            val query: String? = null
            val expectedResult = mockk<List<Album>>()
            coEvery { albumRepositoryMock.searchAlbum(query) } returns Result.Success(expectedResult)

            // Act
            build()
            val result = getAlbumListUseCase(query)

            // Assert
            coVerify { albumRepositoryMock.searchAlbum(query) }
            assertEquals(Result.Success(expectedResult), result)
        }

    @Test
    fun `given repository returns Result Error, when invoking GetAlbumListUseCase, then it should return Result Error`() =
        runTest {
            // Arrange
            val query = "pop"
            val expectedError = Result.Error("Repository error")
            coEvery { albumRepositoryMock.searchAlbum(query) } returns expectedError

            // Act
            build()
            val result = getAlbumListUseCase(query)

            // Assert
            coVerify { albumRepositoryMock.searchAlbum(query) }
            assertEquals(expectedError, result)
        }
}
